    "translocation-and-banding-of-aleutian-canada-geese-in-the-western-aleutian-islands-in-1990",nt"isopen":
    false,nt"url": null,nt"notes": "In August 1990, 110 Aleutian Canada geese
    (Branta canadensis leucopareia) were captured and banded at Buldir Island. Twenty-five
    of these geese were translocated to Little Kiska Island, 38 birds were moved to
    Nizki-Alaid Island, and the remainder were released on Buldir. Five additional geese
    died during the project, 3 in a hold1ng pen at Buldir, and 2 aboard M/V Tiglax while
    in transit to Little Kiska. Only two of the geese moved to Nizki-Alaid were known
    to have died after release, and no mortality was recorded among the 25 geese released
    at Little Kiska.",nt"license_title": "License Not Specified",nt"extras":
